import React from "react";


export default function WeatherIcon(props) {
  const codeMapping = {
    "01d": "SUN",
    "01n": "SUN",
    "02d": "SUN_CLOUD",
    "02n": "SUN_CLOUD",
    "03d": "CLOUD",
    "03n": "CLOUD",
    "04d": "SUPER_CLOUD",
    "04n": "SUPER_CLOUD",
    "09d": "LIGHT_RAIN",
    "09n": "LIGHT_RAIN",
    "10n": "HEAVY_RAIN",
    "10d": "HEAVY_RAIN",
    "11d": "STORM",
    "11n": "STORM",
    "13d": "SNOW",
    "13n": "SNOW",
  };

  return (
    <div id="main-icon">
      <img
        id="main-icon"
        src={"images/" + codeMapping[props.code] + ".png"}
        alt="main-icon"
        size={props.size}
      />
    </div>
  );
}
